rule "Winrm Log Event Id Enrichment"

when
	to_string($message.Channel) == "Microsoft-Windows-WinRM/Operational"
then
    set_field("WinrmEventName", lookup_value("winrm", $message.EventId));
   	set_field("TimelineSource","WinRM");
	set_field("TimelineEvent","true");
end

rule "RDP Log Event Id Enrichment"

when
	to_string($message.Channel) == "Microsoft-Windows-TerminalServices-LocalSessionManager/Operational" OR
	to_string($message.Channel) == "Microsoft-Windows-TerminalServices-RemoteConnectionManager/Operational"
then
	set_field("TimelineCategory", lookup_value("rdp", $message.EventId));
	set_field("Timelinesource","RDP");
	set_field("TimelineEvent","true");
end

rule "Defender Log Event Id Enrichment"

when
	to_string($message.Channel) == "Microsoft-Windows-Windows Defender/Operational"
then
	//set_field("DefenderEventName", lookup_value("defender", $message.EventId));
	//set_field("Debug",$message.EventId);
	set_field("TimelineCategory", lookup_value("defender", $message.EventId));
	set_field("TimelineSource","Windows Defender");
	set_field("TimelineEvent","true");
end

rule "Task Scheduler Log Event Id Enrichment"

when
	to_string($message.Channel) == "Microsoft-Windows-TaskScheduler/Operational"
then
	set_field("TimelineCategory", lookup_value("taskscheduler", $message.EventId));
	set_field("TimelineSource","TaskScheduler");
    set_field("TimelineEvent","true");
end

