rule "Windows Log Event Id Enrichment"

when
	to_string($message.Channel) == "System" OR
	to_string($message.Channel) == "Security" OR
	to_string($message.Channel) == "Application" 
then
	set_field("TimelineCategory", lookup_value("windows", $message.EventId));
    set_field("TimelineSource","WindowsEventLog");
    set_field("TimelineEvent","true");
end

rule "Sysmon Log Event Id Enrichment"

when
	to_string($message.Channel) == "Microsoft-Windows-Sysmon/Operational"
then
	set_field("TimelineCategory", lookup_value("sysmon", $message.EventId));
    set_field("TimelineSource","Sysmon");
    set_field("TimelineEvent","true");
end

rule "PowerShell Encrichment"
when
  to_string($message.Channel) == "Microsoft-Windows-PowerShell/Operational"

then
    set_field("TimelineCategory", "Powershell Script");
	set_field("TimelineSource","Windows Powershell");
	set_field("TimelineEvent","true");
end
